 import React from "react";
 
 class Userclass extends React.Component {
    render() {
        return (
            <div className="users">
             <h2>Name: Avanti Tatwawadi</h2>
             <h3>Location: Bangalore</h3>
             <h3>Social Media: @avanti2710</h3>
     
            </div> 
            
         )
    }
 }

 export default Userclass;
